import './index.css';

function TodoMenu({ todos, setTodos, onFilterActivesTodos, onFilterCompletedTodos, onShowAllTodos }) {
   return (
      <nav className="TodoMenu">
         <button className="TodoMenuItem" onClick={onFilterActivesTodos}>Active</button>
         <button className="TodoMenuItem" onClick={filterCompletedTodos}>Completed</button>
         <button className="TodoMenuItem" onClick={showAllTodos}>ALL</button>
      </nav>
   );
}

export { TodoMenu };
